import { Facebook, Instagram, WhatsApp } from '@material-ui/icons';
import React from 'react'
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
`;

const Left = styled.div`
  flex: 1;
`;

const Center = styled.div`
  flex: 1;  
`;

const Right = styled.div`
  flex: 1;
`;


const Footer = () => {
  return (
    <Container>
      <Left>
        <Logo>AHMA'S HOMEMADE</Logo>
        <Desc>👵🏼Secret Recipe by two passionate Ah Ma👵</Desc>
        <SocialContainer>
          <SocialIcon>
            <Facebook/>
          </SocialIcon>
          <SocialIcon>
            <Instagram/>
          </SocialIcon>
          <SocialIcon>
            <WhatsApp/>
          </SocialIcon>
        </SocialContainer>
      </Left>
      <Center></Center>
      <Right></Right>

    </Container>
  )
}

export default Footer
